import React from 'react';
import Grid from '@material-ui/core/Grid';
import Logo from './Logo.js';

export default class ToDoList extends React.Component {
    constructor() {
        super();
        this.state = {};
    }

    render() {
        return (
            <div>
            <Grid container spacing={3}>
                <div className="mainMenu">
                    <Grid item xs={12}>
                    <Logo/>
                    </Grid>
                </div>
            </Grid>
            </div>
        )
    }
}
